import React from 'react';

const UsersView = ({ users }) =>
  users.map(({name, image, statusText}) => (
    <div key={user.name}>
      <p>{user.name}</p>
      <img src={user.image} alt='user' />
      <p>{user.statusText}</p>
    </div>
  ));

export default UsersView;
